import React, { Component } from "react";
// css
import "../assets/scss/header.scss";

export default class Header extends React.Component {
  state = {};
  componentDidMount() {}

  render() {
    return (
      <header className="header">
        <h1>Header</h1>
      </header>
    );
  }
}
